INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "お！\nあそこに困ってそうな人発見！", 1001, 0, 0, "春咲 ひより", 1, 2, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "大切な人を\n守れるようになりたい…って", 1002, 0, 0, "草野 優衣", 1, 2, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "キミに必要な集中力と感性が", 1003, 0, 0, "士条 怜", 1, 2, 1, 0, "フェンシングを始めてみては？", 0, "少しは磨かれると思いますよ。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "今日はなにして遊ぶ？", 1004, 0, 0, "穂高 みそぎ", 1, 2, 1, 0, "ねぇ、にいちゃん！", 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "ねぇ…", 1006, 0, 0, "風宮 あかり", 1, 2, 1, 0, "風宮あかりです", 0, "私といっしょに…\nいかない？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "プリンたべたいのー", 1007, 0, 0, "出雲 宮子", 1, 2, 1, 0, "出雲宮子なのー", 0, "食べ物の恨みは怖いのー", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 0, 0, "虹村 雪", 1, 2, 1, 0, "ボクは虹村雪。", 0, "いいよ。\n見られることは運命さ…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 0, 0, "柊杏奈", 1, 2, 1, 0, "フッ…聞いて後悔するがいい！", 0, "人呼んで「疾風の冥姫」!!", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 0, 0, "姫宮 真歩", 1, 2, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "ほんまおおきにやわ～♪", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 0, 0, "衣之咲 璃乃", 1, 2, 1, 0, "衣之咲璃乃です！", 0, "ここで会ったが\n100年目～！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "ち、超能力って…\n何のことかな～？", 1012, 0, 0, "柏崎 初音", 1, 2, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "…って、お願い！\n誰にも言わないでおいて～！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "一応カリスマ読モJKやってまっす！", 1016, 0, 0, "美波 鈴奈", 1, 2, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "東京は遊園地みたいなところさー", 1017, 0, 0, "喜屋武 香織", 1, 2, 1, 0, "はいたーい。\n喜屋武香織さー。", 0, "でも、沖縄もとってもいいとこさー", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "先生って呼ばれるのは\nくすぐったいから", 1018, 0, 0, "支倉 伊緒", 1, 2, 1, 0, "支倉伊緒です。", 0, "イオちゃんって呼んでね。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 0, 0, "茜 ミミ", 1, 2, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "ミミをおいてかないでぇ～", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "あの……\nふぇ……", 1021, 0, 0, "栗林 くるみ", 1, 2, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "ふぇぇぇぇぇん……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "こんな私に貴重な時間を\n割いていただき、", 1022, 0, 0, "風宮 より", 1, 2, 1, 0, "風宮よりです。\nあああああ！", 0, "なんてありがとうございます！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "おにいちゃんどこいくの？\nえ？", 1023, 0, 0, "北条 綾音", 1, 2, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "私こっち行きたいー\nね、早く早くー", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 0, 0, "天野 すずめ", 1, 2, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, "これて何か違う…\nあああすみません！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "あなたは…運命の……\n伴侶……", 1027, 0, 0, "倉石 恵理子", 1, 2, 1, 0, "……クスクス…私は\n…倉石恵理子……", 0, "離しませんわ………\n絶対に…!!", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 0, 0, "佐々木 咲恋", 1, 2, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "…そうでしょ？？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "ぇっと…\nキミ、私のこと知らないの?!", 1029, 0, 0, "桜井 望", 1, 2, 1, 0, "桜井望だよ！\nよろしくねっ", 0, "あはは、\n私もまだまだだなぁ～", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 0, 0, "ニノン・ジュベール", 1, 2, 1, 0, "デケデケデンっ！", 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "でもって私の隣にいるのが……\nえ、見えない？", 1031, 0, 0, "上喜 しのぶ", 1, 2, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, "おかしいですね……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "けんども\nそれには足りないモンが…", 1033, 0, 0, "野戸まひる", 1, 2, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "そう、\nオラのボケに突っ込める相方が…！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "ちょっと緊張しちゃって…", 1034, 0, 0, "綾瀬 ゆかり", 1, 2, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょ\nちょっと一杯飲んできます…！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "知らない人とは話しちゃいけないので", 1036, 0, 0, "氷川 鏡華", 1, 2, 1, 0, "氷川鏡華…です", 0, "これ以上お話しすることは…\nないです！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "……あ、アラーム。", 1038, 0, 0, "柏崎 栞", 1, 2, 1, 0, "柏崎…栞です。", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "私、一人も友達がいなくて……", 1040, 0, 0, "双葉 碧", 1, 2, 1, 0, "ふ、双葉碧です。", 0, "野に咲く花が、\n唯一の話相手です。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 0, 0, "三角 千歌", 1, 2, 1, 0, "三角千歌です。", 0, "そう思っています。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "あぁ？\nお前のそいつの仲間か？", 1043, 0, 0, "安芸 真琴", 1, 2, 1, 0, "安芸真琴だ。", 0, "う、疑ってすまなかったな…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "生けとし生ける全ての者よ！", 1044, 0, 0, "イリヤ・オーンスタイン", 1, 2, 1, 0, "わらわこそは夜を総べる者！", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "ぐふふふふ……はっ！", 1045, 0, 0, "遠見 空花", 1, 2, 1, 0, "そこで騎士は妖精を乱暴に……", 0, "ｌク、クウカに何かご用ですか!?", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 0, 0, "宮坂たまき", 1, 2, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "それでは早速クエストに…", 1048, 0, 0, "大神 美冬", 1, 2, 1, 0, "大神美冬よ！", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "クエストもバトルも\n掃除も洗濯も", 1049, 0, 0, "星野静流", 1, 2, 1, 0, "星野静流だよ！", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "見ての通りの\nセクシー美少女で", 1050, 0, 0, "玉泉美咲", 1, 2, 1, 0, "アタシは玉泉美咲。", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 1, "？？？？", 1052, 0, 0, "リマ", 1, 2, 1, 0, "？？？", 0, "？？？？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1053, 0, 0, "モニカ・ヴァイスヴィント", 1, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1058, 0, 0, "ペコリーヌ", 1, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1059, 0, 0, "コッコロ", 1, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1060, 0, 0, "キャル", 1, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 0);
